('33986b9f-d98f-4103-bec2-097b38adebae', '381e9201-5822-4783-919f-13f83bd6e10b', 3, 'IKIGLO210VM', 'LR3OT1ME9BC14B13ZGOT', 'Mamador COOKING OIL- 1.5L', '1400', '1600', 1, 9, 'Mamador', 'Available', 1, 1, '<div class=\"markup -mhm -pvl -oxa -sc\"><p style=\"caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\">Mamador\r\n is a healthy cooking oil for heart health and tasty meals. It\'s \r\ncholesterol free and also contains Omega 6 &amp; 9 proven to keep heart \r\nhealthy. It is triple filtered to deliver superior golden colour and \r\nensure removal of all impurities thus 100% Pure. Mamador Pure Vegetable \r\nOil is a healthy choice for your daily cooking as it also contains \r\nVitamins A and E, which provide major health benefits to the whole \r\nfamily.</p><p style=\"caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\">Other benefits of Mamador Pure Vegetable Oil include its stability under the Nigerian climate. It does not oxidize in sunlight.</p><p style=\"caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\">It\r\n is suitable for all types of cooking, frying and baking and brings out \r\nthe expected natural taste on any meals prepared with it.</p><p style=\"caret-color: rgb(0, 0, 0); color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px;\">Mamador\r\n Cooking Oil is produced and packaged locally (in Nigeria) in a world \r\nclass refinery- ISO, NAFDAC and CODEX-certified manufacturing \r\nenvironment which guarantees 100% product quality and freshness.</p><ul><li>Tamper proof packaging</li><li>Cholesterol Free</li><li>Free from artificial additives</li><li>Natural source of Vitamin E</li><li>Fortified with Vitamin A</li><li>Naturally contains Omega 6 &amp; 9</li></ul></div>', '<div class=\"row -pas\"><article class=\"col8 -pvs\"><di