('b14346a3-228d-4367-93aa-f4489bc696df', '381e9201-5822-4783-919f-13f83bd6e10b', 3, '1QQ7RUT6BWI', '7XP4RX2G00LRD734YTNM', 'Microwave Oven With 20Liters Blender-999 Toaster', '36575', '42900', 3, NULL, NULL, 'Available', 1, 1, '<header class=\"-pvs -bb\"><h2 class=\"-fs20 -m -phm -pvxs\"><br></h2></header><div class=\"markup -mhm -pvl -oxa -sc\">&nbsp;Microwave\r\n with&nbsp; 20 Ltrs Capacity is a necessity to every household that will help\r\n you heat and defrosts your food items in a well-timed manner to give it\r\n a fresh taste. It is energy efficient so it will consume less \r\nelectricity and it also works well with low voltage. It has 5 power \r\nlevels that make it easy for you to adjust the heat to suit your \r\npreference. It gets your frozen foods defrost in a very little time. It \r\nis designed with manual knobs for adjusting the time to suit the kind of\r\n dish you have in it. Once the time set is reaches, the microwave oven \r\nautomatically turns itself off. It can be used to warm/heat all kinds of\r\n food items.<br><p style=\"margin-bottom: 9.5px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\"><br></p></div>', '<p style=\"margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\">Microwave oven 20L</p><p style=\"margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\">Input power: varies</p><p style=\"margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\">Power output: vares</p><p style=\"margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\">Grill power input: varies</p><p style=\"margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\">Power supply: varies</p><p style=\"margin-bottom: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 18px; font-family: Lato, sans-serif; font-size: 13px; vertical-align: baseline; color: rgb(144, 144, 144);\"><br></p><ul class=\"-pvs -mvxs -phm -lsn\"><li class=\"-pvxs\"><span class=\"-b\">SKU</span>: GE779HL0XUT6GNAFAMZ</li><li class=\"-pvxs\"><span class=\"-b\">Area of Use</span>: Dining Room|Kitchen|Home Office|Outdoor</li><li class=\"-pvxs\"><span class=\"-b\">Style</span>: Modern</li><li class=\"-pvxs\"><span class=\"-b\">Color</span>: N/A</li><li class=\"-pvxs\"><span class=\"-b\">Main Material</span>: Plastic&amp; Stainless Steel</li><li class=\"-pvxs\"><span class=\"-b\">Model</span>: N/A</li><li class=\"-pvxs\"><span class=\"-b\">Product Line</span>: Mummy\'s Choices store</li><li class=\"-pvxs\"><span class=\"-b\">Weight (kg)</span>: 10</li></ul>', NULL, '2021-01-18 10:02:48 am', '2021-01-23 01:07:57 pm', 1, 0),
('ffdb9921-68f5-4e1b-b000-92fe50d0105e', '381e9201-5822-4783-919f-13f83bd6e10b', 3, '3OEKD0OZ6ZE', 'KLTLWL2V7VHLH7LSOEQW', 'Air wick Freshmatic Lavender Air Freshner Refill - Pack Of 2', '3850', '5200', 3, NULL, NULL, 'Available', 1, 1, 'The Freshmatic automatic air fresheners automatically releases bursts of\r\n fragrance for constant freshness&nbsp;in your home. The regular release of \r\nfine mist of fresh fragrance spread throughout the room so you can enjoy\r\n fresh waves of scent right throughout the day.<br><b>Lavender and Camomile</b>\r\n is a characterful fragrance of aromatic Lavender essence&nbsp;rounded off \r\nwith gentle Chamomile and precious woods.&nbsp;This refill can lasts up to <b>50 days</b>.<br>Before\r\n inserting this aerosol refill, check that your automatic device switch \r\nis on the OFF position. Direct the device away from the face before \r\nswitching on. When it is switched on, the device will automatically \r\nspray after 15 seconds.For safety reasons, follow carefully the \r\ndirections for use supplied with your Freshmatic device.<br><b>Caution:</b>\r\n Use only as directed. Keep out of reach of children. Intentional misuse\r\n by deliberately concentrating and inhaling the content can be harmful \r\nor fatal. Use only in well ventilated areas.Do not breathe in aerosol.<br><b>Ingredients:</b> Ethanol,Propellant, Water, Fragrance, Sodium Borate Decahydrate.&nbsp;', '<div class=\"markup -pam\"><ul><li>Lavender Scent</li><li>250ml Freshmatic Refill can</li><li>Enjoy amazing time-released fragrances</li><li>Keeps your home smelling fresh</li><li class=\"-pvxs\"><span class=\"-b\">SKU</span>: AI122GR056VMRNAFAMZ</li><li class=\"-pvxs\"><span class=\"-b\">NAFDAC No.</span>: N/A</li><li class=\"-pvxs\"><span class=\"-b\">Production Country</span>: United Arab Emirates</li><li class=\"-pvxs\"><span class=\"-b\">Product Line</span>: Reckitt Benckiser Nigeria Ltd</li><li class=\"-pvxs\"><span class=\"-b\">Weight (kg)</span>: 0.7</li></ul></div>', NULL, '2021-01-18 10:04:44 am', '2021-01-18 10:04:44 am', 1, 0);

